const Index =()=>{
    return (
        <React.Fragment>
            <Head>
            <title>Home </title>
            <meta name="viewport" content="initial-scale=1.0, width=device-width" />
            </Head>
            <h1>Index Page</h1>
        </React.Fragment>
    )
}

export default Index
